  /**
   * The set of collected tissues generated by a therapeutic or diagnostic surgical procedure, the evaluation 
   * of which generates a surgical pathology report. 
   * 
   */

public  class SurgicalPathologySpecimen 
    extends AnnotationSet
	implements java.io.Serializable 
{
	private static final long serialVersionUID = 1234567890L;

	
	   
	   private java.util.Collection surgicalProcedure;
	   public  java.util.Collection getSurgicalProcedure(){
	      return surgicalProcedure;
	   }
	   public void setSurgicalProcedure( java.util.Collection surgicalProcedure){
	      this.surgicalProcedure = surgicalProcedure;
	   }
	
	   
	   private java.lang.String surgicalProcedureMVR;
	   public  java.lang.String getSurgicalProcedureMVR(){
	      return surgicalProcedureMVR;
	   }
	   public void setSurgicalProcedureMVR( java.lang.String surgicalProcedureMVR){
	      this.surgicalProcedureMVR = surgicalProcedureMVR;
	   }
	

	

		public boolean equals(Object obj){
			boolean eq = false;
			if(obj instanceof SurgicalPathologySpecimen) {
				SurgicalPathologySpecimen c =(SurgicalPathologySpecimen)obj; 			 
				Long thisId = getId();		
				
					if(thisId != null && thisId.equals(c.getId())) {
					   eq = true;
				    }		
				
			}
			return eq;
		}
		
		public int hashCode(){
			int h = 0;
			
			if(getId() != null) {
				h += getId().hashCode();
			}
			
			return h;
	}
	
	
}